INSERT INTO `t_essay` VALUES ('263024', '195115', 'heihei', '前端最全的框架总结', '<p>本文作者祈澈姑娘，转载请声明<br><br>前端的技术日渐更新，最近得空，花了一上午的时间，将前端常见的框架总结了一下，在开发的过程之中，有了这些，不断能够提高自己的工作效率，还可以在工作之余了解更多。希望大家喜欢。<br><br>1.Layui<br><br>官方网址：http://www.layui.com/<br><br>Layui是一款采用自身模块规范编写的国产前端UI框架，遵循原生HTML/CSS/JS的书写与组织形式，门槛极低，拿来即用。从核心代码到API的每一处细节都经过精心雕琢，非常适合界面的快速开发。，从核心代码到API的每一处细节都经过精心雕琢，非常适合界面的快速开发。Layui还很年轻，首个版本发布于2016年金秋，她区别于那些基于MVVM底层的UI框架，却并非逆道而行，而是信奉返璞归真之道。准确地说，她更多是为服务端程序员量身定做，你无需涉足各种前端工具的复杂配置，只需面对浏览器本身，让一切你所需要的元素与交互，从这里信手拈来。<br><br><br>经典模块化前端框架<br>2.NEC：<br><br>官方网址：http://nec.netease.com/case<br><br>你是否常常碰到以下问题：你总是看不懂他写的代码，或者读起来很吃力；你需要改他的代码却无从下手，或总是要去问他这里是什么改了会不会影响其他代码；你和他一起开发一个产品，你总是怕代码和他有冲突或互相影响；你的代码在多次维护任务之后变得越来越臃肿，越来越难以维护，解决以上问题只需一种方法——读我们的规范！<br><br><br>国产web前端框架推荐之–NEC<br>3：amaze UI<br><br>官方网址：http://amazeui.org/<br><br>之前公司的网站被黑客攻击之后，整个网站的东西都用不了了，处于丢失和瘫痪的状态，楼主毫不犹豫在这个网站上找了一个框架，仅仅两三天的时间，就成功挽救了这一糟糕的局面，还是要感谢我们这强大的框架，妹子UI,适配pc端和移动端，功能齐全，网站开发什么的，都SOeasy<br><br><br>中国首个开源 HTML5 跨屏前端框架.<br>4.NEJ<br><br>官方网址：http://nej.netease.com/<br><br>NEJ全称：Nice Easy Javascript 是由网易前端组工程师们发起创建的简洁，美观，真正的跨平台web前端开发框架；在适配性上支持桌面及移动平台、浏览器及混合应用开发，补丁模式无缝扩展适配平台，配置方式灵活定制目标平台<br><br><br>5.boostrap<br><br>框架官方网址：http://www.bootcss.com/<br><br>这个我就不多说了，大多数人都在用这个框架来开发，官方文档的API完整可靠，还有各种Bootstrap相关优质项目推荐，前端开发首选框架<br><br><br>简洁、直观、强悍的前端开发框架，让web开发更迅速、简单。<br>6：Foundation<br><br>官方网址：http://www.foundcss.com/<br><br>Foundation 是一个易用、强大而且灵活的响应式前端框架，用于构建基于任何设备上的响应式网站、 Web应用和电子邮件。结构语义化、移动设备优先、完全可定制。<br><br><br>响应式前端框架<br>7.Jquery代码库<br><br>官方网址：http://www.jqueryui.org.cn/<br><br><br>基于Jquery的开源网页用户界面代码库：<br>8.jQuery插件库<br><br>官方网址：http://www.jq22.com/<br><br>史上最全的jQuery效果，包括了开发所需要的所有需求的demo，如果有不会的东西，就来jQuery插件库吧，这里总有一些你想要的，还在等什么？<br><br><br>9.FrozenUI<br><br>官方网址：http://frozenui.github.io/<br><br>随心所用的样式组件，更显灵动的JS插件，酷炫好玩的案例秀，提供的Animationcase，把业务上有趣好玩的案例沉淀下来，帮助日后能更快速找到设计灵感。FrozenUI是一个开源的简单易用，轻量快捷的移动端UI框架。基于手Q样式规范，选取最常用的组件，做成手Q公用离线包减少请求，升级方式友好，文档完善，目前全面应用在腾讯手Q增值业务中。<br><br><br>移动端开发专用框架：<br>10：SUI<br><br>官方网址：http://m.sui.taobao.org/<br><br>SUI是一套基于bootstrap开发的前端组件库，同时她也是一套设计规范。通过SUI，可以非常方便的设计和实现精美的页面。同时sui还有移动端版本msui，msui是阿里巴巴共享业务事业部UED团队的作品。目的是为了手机H5页面提供一个常用的组件库，减少重复工作。<br><br><br>搭建手机H5应用：<br>11:AUI<br><br>官方网址：http://www.auicss.com/<br><br>AUI2.0是一套全新的AUI框架，在1.X基础上进行了重新架构。结合实际项目出发，站在开发者和项目的角度，重新定义AUI框架。在2.0中使用了大量弹性响应式布局，采用容器+布局结构+控件的嵌套形式，方便开发者快速布局样式。我们充分吸取了AUI使用者的反馈意见和借鉴了市场上其他优秀UI框架，完成了2.0版本的开发。2.0遵循GoogleMaterial 设计规范，使用MIT开源协议。<br><br><br>12:MUI：<br><br>官方网址：http://dev.dcloud.net.cn/mui/<br><br>最接近原生APP体验的高性能前端框架,相信这个大家都不陌生：鉴于之前的很多前端框架（特别是响应式布局的框架），UI控件看起来太像网页，没有原生感觉，因此追求原生UI感觉也是我们的重要目标MUI以iOS平台UI为基础，补充部分Android平台特有的UI控件<br><br><br>13:Semantic UI<br><br>官方网址：http://www.semantic-ui.cn/<br><br>Semantic作为一款开发框架，帮助开发者使用对人类友好的HTML语言构建优雅的响应式布局。更快地设计赏心悦目的网站<br><br><br>14.Aliceui<br><br>官方网址：http://www.oschina.net/p/aliceui?fromerr=mgWZvlr0<br><br>Aliceui是支付宝的样式解决方案，是一套精选的基于 spm 生态圈的样式模块集合，是 Arale 的子集，也是一套模块化的样式命名和组织规范，是写 CSS 的更好方式。<br><br><br>15.H-ui<br><br>官网地址：http://www.h-ui.net/<br><br>H-ui是轻量级前端框架，简单免费，兼容性好，适用于中国网站。H-ui是一个相对成长比较慢的前端框架，相比目前行业众多框架还有很多不足。但初心不改，实实在在把事做好，做用户最喜欢的框架。<br><br><br>16.Weui<br><br>官网地址：https://github.com/weui/weui<br><br>weUI是一套同微信原生视觉体验一致的基础样式库，由微信官方设计团队为微信 Web开发量身设计，可以令用户的使用感知更加统一。包含button、cell、dialog、 progress、toast、article、actionsheet、icon等各式元素。<br><br><br>17.YDUI Touch<br><br>官网地址：http://www.ydui.org/<br><br>YDUI Touch 专为移动端打造，在技术实现、交互设计上兼容主流移动设备，保证代码轻、性能高;使用 Flex 技术，灵活自如地对齐、收缩、扩展元素，轻松搞定移动页面布局;实现强大的屏幕适配布局，等比例适配所有屏幕。什么？用得不开心？轻松切换 px;自定义JavaScript组件、Less文件、Less变量，定制一份属于自己的YDUI;<br><br><br>一只注重审美，且性能高效的移动端&amp;微信UI。<br><br>作者：祈澈姑娘<br>链接：http://www.jianshu.com/p/2a8ce7075d79<br>來源：简书<br>著作权归作者所有。商业转载请联系作者获得授权，非商业转载请注明出处。</p>', null, '2017-08-16 22:57:22', '00000000000', '00000000000', '00000000000', '0000000000', '00000000000', '0', '0', '1');
INSERT INTO `t_essay` VALUES ('263025', '195101', 'caitou', '云计算入门', '什么是云计算呢? 其实云端(cloud)就代表了互联网(Internet)，通过网络的计算能力，取代使用你原本安装在自己电脑上的软件，或者是取代原本你把资料存在自己硬盘的动作，你转而通过网络来进行各....', null, '2017-08-17 09:56:41', '00000000005', '00000000000', '00000000000', '0000000000', '00000000000', '0', '0', '7');
INSERT INTO `t_essay` VALUES ('263026', '195117', 'luyouqi', '多设备蜂巢式讯号测试解决方案', '<p>莱特菠特(LitePoint)近日宣布推出LitePoint IQcell多设备蜂巢式讯号测试解决方案，该解决方案可对LTE行动通讯设备进行用户体验测试。<br><br>LitePoint产品营销总监Adam Smith表示，用户体验是一个行动装置取得成功的关键，IQcell可帮助OEM厂商和服务中心见用户之所见，而不是将某些参数测定转化为用户对产品的实际体验。 IQcell节省了测试时间，降低了测试成本，可快速有效地在多台设备上同时完成各类讯号测试。<br><br>IQcell专为行动装置原始设备制造商(OEM)设计，用于测试设备主流功能的性能，如行动热点功能、VoLTE通话、网页浏览和串流视讯等。 对这些应用的测试均在无线连接下完成，以模仿真实的用户体验情境。<br><br>该解决方案提供了快速、高效率的方法来准确定位用户报告的故障根源，以便设备维修服务中心能够使用IQcell和IQservice软件，对客户送修的手机进行射频(RF)参数测试，设备制造商和电信营运商就能够维修故障手机，而不是用新机替换原本轻易就可修好的手机，从而节省了成本。<br><br>IQcell 2埠和8埠配置，支持LTE-FDD、LTE-TDD、WCDMA/HSPA和GSM。 IQcell 2埠配置能快速诊断物联网设备行动无线电质量，而透过执行预先设定的一套测试案例，自动测试系统能够探测行动通讯性能。 IQcell 8埠配置可增强测试能力，同时测试4台执行于4个独立行动网络的设备，每个行动网络有专门的量测系统，以进行高速、高准确度和特定射频的参数测量。</p>', null, '2017-08-17 10:25:27', '00000000000', '00000000000', '00000000000', '0000000000', '00000000000', '0', '0', '9');
INSERT INTO `t_essay` VALUES ('263027', '195117', 'luyouqi', 'spark基础知识', 'spark基础知识 1.Spark是什么? UCBerkeley AMPlab所开源的类HadoopMapReduce的通用的并行计算框架。 dfsSpark基于mapreduce算法实现的分布式计算，拥有HadoopMapReduce所具有的优点;但不同于Map...', null, '2017-08-17 10:34:46', '00000000000', '00000000000', '00000000000', '0000000000', '00000000000', '0', '0', '3');
INSERT INTO `t_essay` VALUES ('263028', '195117', 'luyouqi', '基于容器编排的Dev/Ops流程 ', '<p>随着 DevOps 和 SRE 概念的流行，越来越多的 developer 和 operater 们摒弃传统的开发部署流程，转向了如下图所示的无线循环模式：<br><br>在我理解 DevOps 包含三个大块：敏捷开发(Agile)、持续集成与交付(CI/CD)、自动运维(ITSM)。 <br><br>在容器化的时代，我们是如何实现 DepOps 或者 SRE 的呢？下面我就来分享一下沪江学习产品线团队基于容器编排的 DevOps 流程。<br>敏捷开发<br><br>大道至简，所有血的教训告诉我们，不要把简单的事情复杂化。换句话说，不要用复杂的方法处理简单的事情。我对敏捷的理解是「快」和「微」。快指迭代快，开发快，上线快，性能快。微指微服务、微镜像。围绕这两点，在开发阶段我们需要做以下几件事：<br>应用微服务化<br><br>这是个比较大的概念，不在这里讨论，有兴趣可以参考我的其他文章。但只有应用小了，才有可能快起来。<br>给 Docker 镜像瘦身<br>为了让 Docker 启动和运行得快，首先就是要对 Docker 瘦身。由于所有的应用全部会统一为 Java 语言开发，所以我们以 Java 为例，选用了 jre-alpine 作为我们的基础镜像，下面是 Dockerfile 的例子：<br><br>FROM java:8-jre-alpine<br>  <br>#add timezone and default it to Shanghai<br>RUN apk --update add --no-cache tzdata<br>ENV TZ=Asia/Shanghai<br>  <br>RUN mkdir -p /app/log<br>COPY  ./target/xxx.jar  /app/xxx.jar<br>  <br>EXPOSE 9999<br>VOLUME [\"/app/log\"]<br>WORKDIR /app/<br>  <br>ENTRYPOINT [\"java\",\"-Xms2048m\", \"-Xmx2048m\", \"-Xss512k\", \"-jar\",\"xxx.jar\"]<br>CMD []<br><br> <br><br>使用上述 Dockerfile 生成的镜像平均只有 80 多 MB，启动时间几乎在 5 秒内。使用 alpine 镜像虽然减小了体积，但缺少一些工具命令，例如 curl 等，可以根据需要酌情安装。另外遇到的一个坑是时区问题：由于 Docker 镜像内的时区是 UTC 时间，和宿主机的东 8 区不一致，所以必须安装 timezone 工具并设置 TZ，才能使容器内时间和宿主机保持一致，对数据库的写入和日志的输出都是非常必要的一环。<br>把所有环境配置包含在镜像中<br><br>早在虚拟机时代，我们已经做到了使用包含依赖的虚拟机镜像来加速部署，那么为什么要止步于此呢？我们可以更进一步，把服务本身也包含在镜像中，Docker 用了更轻量的方式已经实现了这一点。<br><br>这里我们还要介绍一个概念，要让制作的镜像，能在所有安装了 Docker 的服务器上运行，而不在乎宿主机的操作系统及环境。借用 Java 的一句话来说：一次制作，多平台运行。所以，我们还会把所有环境的配置文件，以不同的文件名全部放入镜像中，通过参数来选择 Docker 启动时使用的环境配置文件。<br><br>值得注意的是，如果开发的应用是基于 spring 框架的话，这个功能很好实现。但如果是其他语言开发，会有一定的开发量。<br><br>本文以默认 Java 开发当所有的开发工作完成后，推荐程序目录结构是这样的：<br><br><br>├── src<br>│   ├── main<br>│   │   ├── java<br>│   │   ├── resources<br>│   │   │   ├── application.yaml<br>│   │   │   ├── application-dev.yaml<br>│   │   │   ├── application-qa.yaml<br>│   │   │   ├── application-yz.yaml<br>│   │   │   ├── application-prod.yaml<br>│   │   │   ├── logback.xml<br>│   ├── test<br>├── scripts<br>│   ├── Dockerfile<br>│   ├── InitDB.sql<br>├── pom.xml<br><br>持续集成与交付<br><br>自动化的持续集成和交付在整个 DevOps 流中起了重要的角色，他是衔接开发和运维的桥梁。如果这一环做的不好，无法支撑大量微服务的快速的迭代和高效运维。在这一环节，我们需要灵活的运用工具，尽量减少人参与，当然仍然需要围绕「快」和「微」做文章。<br><br>如何减少人工参与到持续集成与持续交付呢？我们最希望的开发过程是：对着计算机说出我们的想要的功能，计算机按照套路，自动编码，自动发布到测试环境，自动运行测试脚本，自动上线。当然，目前时代要实现自动编码的过程还需要发明那只「猫」。<br><br>但只要对测试有足够信心，我们完全可以实现一种境界：在炎热的下午，轻松地提交自己编写的代码，去休息室喝杯咖啡，回来后看见自己的代码已经被应用在生产环境上了。在容器时代，我们可以很快速的实现这一梦想，其具体步骤如下图：<br><br><br><br>Gitfolw 与 Anti-Gitflown<br><br>持续集成的第一步是提交代码（Code Commit），VCS 也由 CVS，SVN 进化到如今的 Git，自然不得不说一下 Gitflow。谈起无人不晓的 Gitflow，大家一定会大谈其优点：支持多团队，设置多国家的开发人员并行开发，减小代码冲突或脏代码的上线概率。它的大致流程如下：<br><br><br>Gitflow 给我们展示了复杂团队在处理不通代码版本的优雅解决方案，它需要feature、develop、release、hotfix、master 5 条分支来处理不同时段的并行开发。但这真的合适于一个不超过 20 人的本地合作团队开发吗？我们的开发团队不足 6 人，每个人负责 3 个以上的微服务，几乎不可能在同个项目上安排两个以上的同学并行开发。<br><br>在初期我们准守规定并使用标准的 Gitflow 流程，开发人员立刻发现一个问题，他们需要在至少 3 条分支上来回的 merge 代码，且不会有任何代码冲突（因为就一个人开发），降低了开发的效率。这让我意识到，Gitflow 模式也许并不适合于小团队微服务的世界，一种反 Gitflow 模式的想法出现在脑海中。我决定对Gitflow 进行瘦身，化繁至简。<br><br><br><br>我们把 5 条分支简化为 3 条分支，其中 Master 分支的作用只是维护了最新的线上版本的作用，Dev 分支为开发的主要分支，所有的镜像是以此分支的代码为源头生成的。这时开发的过程变为：<br><br><br>    开发人员从 Dev 分支中 checkout 新的 feature 分支，在 feature 分支上进行开发<br><br>    当开发完成后 merge 回 Dev 分支中，根据 Dev 分支的代码打成镜像，部署 QA 环境交给 QA 人员测试<br><br>    测试中如有 bug 便在新分支中修复问题循环步骤 2<br><br>    测试完成 merge 回 Master 分支<br><br>如此一来，只有从 Feature 把代码 merge 到 Dev 分支的一次 merge 动作，大大提升可开发效率。<br>使用Jenkins Pipeline<br><br>Jenkins 作为老牌 CI/CD 工具，能够帮我们自动化完成代码编译、上传静态代码分析、制作镜像、部署测试环境、冒烟测试、部署上线等步骤。尤其是Jenkins2.0 引入 Pipeline 概念后，以上步骤变的如此行云流水。它让我们从步骤 3 开始，完全可以无人值守完成整个集成和发布过程。<br><br>工欲善其事必先利其器，首先我们必须要在 Jenkins 上安装插件 ：<br><br><br>    Pipeline Plugin（如果使用Jenkins2.0默认安装）<br><br>    Git<br><br>    Sonar Scaner<br><br>    Docker Pipeline Plugin <br><br>    Marathon<br><br>如果你第一次接触 Jenkins Pipeline，可以从https://github.com/jenkinsci/pipeline-plugin/blob/master/TUTORIAL.md找到帮助。<br><br>现在，我们开始编写 Groove 代码。基于容器编排的 Pipeline 分为如下几个步骤：<br>1.检出代码<br><br>这个步骤使用 Git 插件，把开发好的代码检出。<br><br>stage(\'Check out\')<br>  gitUrl = \"git@gitlab.xxxx.com:xxx.git\"<br>  git branch: \"dev\", changelog: false, credentialsId: \"deploy-key\", url: gitUrl<br><br><br>2.maven 构建 Java 代码<br><br>由于我们使用的是 spring boot 框架，生成物应该是一个可执行的 jar 包。<br><br> stage(\'Build\')<br>  sh \"${mvnHome}/bin/mvn -U clean install\"<br><br>3. 静态代码分析<br><br>通过 Sonar Scaner 插件，通知 Sonar 对代码库进行静态扫描。<br><br>stage(\'SonarQube analysis\')<br>   // requires SonarQube Scanner 2.8+<br>   def scannerHome = tool \'SonarQube.Scanner-2.8\';<br>   withSonarQubeEnv(\'SonarQube-Prod\') {<br>     sh \"${scannerHome}/bin/sonar-scanner -e -Dsonar.links.scm=${gitUrl} -Dsonar.sources=. -Dsonar.test.exclusions=file:**/src/test/java/** -Dsonar.exclusions=file:**/src/test/java/** -Dsonar.language=java -Dsonar.projectVersion=1.${BUILD_NUMBER} -Dsonar.projectKey=lms-barrages -Dsonar.projectDescription=0000000-00000 -Dsonar.java.source=8 -Dsonar.projectName=xxx\"<br>   }<br><br><br>4.制作 Docker 镜像<br><br>此步骤会调用 Docker Pipeline 插件通过预先写好的 Dockerfile，把 jar 包和配置文件、三方依赖包一起打入 Docker 镜像中，并上传到私有 Docker 镜像仓库中。<br><br>stage(\'Build image\')<br>  docker.withRegistry(\'https://dockerhub.xxx.com\', \'dockerhub-login\') {<br>    docker.build(\'dockerhub.xxx.com/xxxx\').push(\'test\') //test是tag名称<br>  }<br><br>5.部署测试环境<br><br>通过事先写好的部署文件，用 Marathon 插件通知 Marathon 集群，在测试环境中部署生成好的镜像。<br><br>stage(\'Deploy on Test\')<br>    sh \"mkdir -pv deploy\"<br>    dir(\"./deploy\") {<br>        git branch: \'dev\', changelog: false, credentialsId: \'deploy-key\', url: \'git@gitlab.xxx.com:lms/xxx-deploy.git\'<br>        //Get the right marathon url<br>        marathon_url=\"http://marathon-qa\"<br>        marathon docker: imageName, dockerForcePull: true, forceUpdate: true, url: marathon_url, filename: \"qa-deploy.json\"<br>    }<br><br><br>6.自动化测试<br><br>运行事先测试人员写好的自动化测试脚本来检验程序是否运行正常。<br><br>stage(\'Test\')<br>   // 下载测试用例代码<br>   git branch: \'dev\', changelog: false, credentialsId: \'deploy-key\', url: \'git@gitlab.xxx.com:lms/xxx-test.git\'<br>   parallel(autoTests: {<br>        // 使用nosetests 运行测试用例<br>        sh \"docker run -it --rm -v $PWD:/code nosetests nosetests -s -v -c conf\\run\\api_test.cfg --attr safeControl=1\"<br>   },manualTests:{<br>        sleep 30000<br>   })<br><br><br>7. 人工测试<br><br>如果对自动化测试不放心，此时可选择结束 Pipeline，进行人工测试。为了说明整个流程，我们这里选择跳过人工测试环节。<br>8. 部署生产环境<br><br>当所有测试通过后，Pipeline 自动发布生产环境。<br><br>stage(\'Deploy on Prod\')<br>    input \"Do tests OK?\"<br>    dir(\"./deploy\") {<br>        //Get the right marathon url<br>        marathon_url=\"http://marathon-prod\"<br>        marathon docker: imageName, dockerForcePull: true, forceUpdate: true, url: marathon_url, filename: \"prod-deploy.json\"<br>    }<br><br><br><br>最后我们来看看整个 Pipeline 的过程：<br><br>容器编排配置文档化<br><br>在介绍敏捷开发时，曾介绍过根据不同环境的配置参数部署到不同的环境。如何告知部署程序用什么样的配置文件启动服务，每个环境又用多少 CPU，内存和 instance 呢？<br><br>下面我们就来介绍一下容器编排的配置文件。由于我们使用 Mesos+Marathon的容器编排方式，部署的重任从以前的写部署脚本变成了写一个 Marathon 的配置，其内容如下：<br><br>{<br>  \"id\": \"/appName\",<br>  \"cpus\": 2,<br>  \"mem\": 2048.0,<br>  \"instances\": 2,<br>  \"args\": [<br>    \"--spring.profiles.active=qa\"<br>  ],<br>  \"labels\": {<br>    \"HAPROXY_GROUP\": \"external\",<br>    \"HAPROXY_0_VHOST\": \"xxx.hujiang.com\"<br>  },<br>  \"container\": {<br>    \"type\": \"DOCKER\",<br>    \"docker\": {<br>      \"image\": \"imageName\",<br>      \"network\": \"USER\",<br>      \"forcePullImage\": true,<br>      \"portMappings\": [<br>        {<br>          \"containerPort\": 12345,<br>          \"hostPort\": 0,<br>          \"protocol\": \"tcp\",<br>          \"servicePort\": 12345<br>        }<br>      ]<br>    },<br>    \"volumes\": [<br>      {<br>        \"containerPath\": \"/app/log\",<br>        \"hostPath\": \"/home/logs/appName\",<br>        \"mode\": \"RW\"<br>      }<br>    ]<br>  },<br>  \"ipAddress\": {<br>    \"networkName\": \"calico-net\"<br>  },<br>  \"healthChecks\": [<br>    {<br>      \"gracePeriodSeconds\": 300,<br>      \"ignoreHttp1xx\": true,<br>      \"intervalSeconds\": 20,<br>      \"maxConsecutiveFailures\": 3,<br>      \"path\": \"/health_check\",<br>      \"portIndex\": 0,<br>      \"protocol\": \"HTTP\",<br>      \"timeoutSeconds\": 20<br>    }<br>  ],<br>    \"uris\": [<br>    \"file:///etc/docker.tar.gz\"<br>  ]<br>}<br><br>我们把这个配置内容保存为不同的 json 文件，每个对应的环境都有一套配置文件。例如 Marathon-qa.json，Marathon-prod.json。当 Pipeline 部署时，可以通过Jenkins Marathon 插件，根据选择不同的环境，调用部署配置，从而达到自动部署的目的。<br>自动化流程和部署上线分离与管理<br><br>开发部署如此的简单快捷，是不是每个人都能方便的使用呢？答案是否定的，并不是因为技术上有难度，而是在于权限。在理想的情况下，通过这套流程的确可以做到在提交代码后，喝杯咖啡的时间就能看见自己的代码已经被千万用户使用了。<br><br>但风险过大，我们并不是每个人都能像 Rambo 一样 bug 的存在，大多数的情况还需要使用规范和流程来约束。就像自动化测试取代不了人工黑盒测试一样，部署测试后也不能直接上生产环境，在测试通过后还是需要有个人工确认和部署生产的过程。<br><br>所以我们需要把自动化流程和最后的部署上线工作分开来，分别变成两个 Job，并给后者单独分配权限，让有权限的人来做最后的部署工作。这个人可以是 Team leader、开发经理，也可以是运维伙伴，取决于公司的组织结构。<br><br>那这个部署的 Job 具体干什么呢？在容器编排时代，结合镜像既构建物的思想，部署 Job 不会从代码编译开始工作，而是把一个充分测试且通过的镜像版本，通过 Marathon Plugin 部署到产线环境中去。这里是 Deploy_only 的例子：<br><br>node(\'docker-qa\'){<br>    if (ReleaseVersion ==\"\"){<br>        echo \"发布版本不能为空\"<br>        return<br>    }<br>    stage \"Prepare image\"<br>        def moduleName = \"${ApplicationModule}\".toLowerCase()<br>        def resDockerImage = imageName + \":latest\"<br>        def desDockerImage = imageName + \":${ReleaseVersion}\"<br>        if (GenDockerVersion ==\"true\"){<br>            sh \"docker pull ${resDockerImage}\"<br>            sh \"docker tag ${resDockerImage} ${desDockerImage}\"<br>            sh \"docker push ${desDockerImage}\"<br>            sh \"docker rmi -f ${resDockerImage} ${desDockerImage}\"<br>        }<br>     <br>    stage \"Deploy on Mesos\"<br>        git branch: \'dev\', changelog: false, credentialsId: \'deploy-key\', url: \'git@gitlab.xxx.com:lms/xxx-test.git\'  <br>        //Get the right marathon url<br>        echo \"DeployDC: \" + DeployDC<br>        marathon_url = \"\"<br>        if (DeployDC==\"AA\") {<br>            if (DeployEnv == \"prod\"){<br>              input \"Are you sure to deploy to production?\"<br>              marathon_url = \"${marathon_AA_prod}\"<br>            }else if (DeployEnv == \"yz\") {<br>              marathon_url = \"${marathon_AA_yz}\"<br>            }<br>        }else if (\"${DeployDC}\"==\"BB\"){<br>          if (\"${DeployEnv}\" == \"prod\"){<br>            input \"Are you sure to deploy to production?\"<br>            marathon_url = \"${marathon_BB_prod}\"<br>          }else if (\"${DeployEnv}\" == \"yz\") {<br>            marathon_url = \"${marathon_BB_yz}\"<br>          }<br>        }<br>        marathon docker: imageName, dockerForcePull: true, forceUpdate: true, url: marathon_url, filename: \"${DeployEnv}-deploy.json\"<br>}<br><br><br>为什么不把这个文件跟随应用项目一起放到 scripts 下呢？因为把部署和应用分开后，可以由两拨人进行维护，兼顾公司的组织架构。<br>自动化运维<br>在 DevOps 的最后阶段是运维阶段。在容器时代，如何对庞大的镜像制品进行运维呢？我们的目标是尽量实现自动化运维，这里主要讲述两点：<br>容器的监控<br><br>容器的监控大致有两种方式：物理机上安装其他服务监控本机上的所有容器；通过 Mesos 或 kubernates 自带 API 监控容器状态。两种方式其实都需要在物理机上安装相应的监控软件或 Agent。<br><br>在我们团队目前使用 cAdvisor+influxDB+Grafana 的组合套件实现对容器的监控。<br><br>首先需要在 Mesos 集群中所有的 Agent 安装 cAdvisor 。他负责把宿主机上所有运行中的容器数据以数据点（data point）形式发送给时序数据库（influxDB），下面是 cAdvisor 监控的一些数据点：<br><br><br>这些数据点经过 Grafana 整理，展示在界面上，这样我们就能掌握具体容器的性能指标了。下面是一个 Grafana 的截图：<br><br><br><br> 除了对容器本身的监控，宿主机的监控也是必不可少的。由于监控的点有很多，这里不一一例举。<br>自动伸缩<br>有了监控指标只是实现了自动化运维的第一步，当业务请求发生大量增加或减少，通过人工监测是不能及时的进行相应的，况且还不一定有那么多的人，7×24 小时的监控。一定需要有一套根据监控数据自行伸缩容的机制。在学习产品线，我们针对容器编排的 Mesos+Marathon 框架，开发了一套针对应用本身的自动扩容微服务。其原理如下：<br><br><br>    通过 Restful 的接口通知 AutoScaler 程序需要监控的应用服务。<br><br>    AutoScaler 程序开始读取每台 Agent 上部署相关应用的 Metrics 数据，其中包括 CPU，内存的使用状况。<br><br>    当发现有应用过于繁忙（其表现形式大多是 CPU 占用过高或内存占用过大）时调用 Marathon API 将其扩容<br><br>    Marathon 收到消息后，立刻通知 Mesos 集群发布新的应用，从而缓解当前的繁忙状况。<br><br>结束语<br><br>DevOps 和 SRE 并不是一个渴望而不可及的概念，它们需要在不同的环境中落地。我们整个 DevOps 流程是建立在容器编排的基础上的，目的是简化流程和实现自动化 CI/CD 和自动化运维。当中会有很多没有想到的地方，可能也不太适用于复杂场景。其次，本文中的例子也做了相应的隐私处理，可能无法直接使用。希望大家能通过我们在实践中产生的成功和遇到的问题，提炼出适合自己的 DevOps 流程。</p>', null, '2017-08-17 10:38:22', '00000000000', '00000000000', '00000000000', '0000000000', '00000000000', '0', '0', '7');
INSERT INTO `t_essay` VALUES ('263029', '195117', 'luyouqi', ' hive安装配置(hive1.2.1) ', '<p>环境centOS 7<br><br>Hive的安装比较简单，只需要在一台机器上配置即可。<br><br>由于hive的一些功能要借助数据库实现，所以要先装好MySQL。<br><br>一.安装mysql<br><br>1.下载MySQL<br><br>在MySQL官网中下载YUM源rpm安装包：http://dev.mysql.com/downloads/repo/yum/<br>MySQL YUM源下载地址<br><br>[java] view plain copy<br><br>    # 下载mysql源安装包  <br>    shell&gt; wget http://dev.mysql.com/get/mysql57-community-release-el7-8.noarch.rpm  <br>    # 安装mysql源  <br>    shell&gt; yum localinstall mysql57-community-release-el7-8.noarch.rpm  <br><br>2、安装MySQL<br><br>[java] view plain copy<br><br>    shell&gt; yum install mysql-community-server  <br><br>3.启动MySQL<br><br>[java] view plain copy<br><br>    shell&gt; systemctl start mysqld  <br><br>查看MySQL的启动状态<br><br>[java] view plain copy<br><br>    shell&gt; systemctl status mysqld  <br>    ● mysqld.service - MySQL Server  <br>       Loaded: loaded (/usr/lib/systemd/system/mysqld.service; disabled; vendor preset: disabled)  <br>       Active: active (running) since 五 2016-06-24 04:37:37 CST; 35min ago  <br>     Main PID: 2888 (mysqld)  <br>       CGroup: /system.slice/mysqld.service  <br>               └─2888 /usr/sbin/mysqld --daemonize --pid-file=/var/run/mysqld/mysqld.pid  <br>      <br>    6月 24 04:37:36 localhost.localdomain systemd[1]: Starting MySQL Server...  <br>    6月 24 04:37:37 localhost.localdomain systemd[1]: Started MySQL Server.  <br><br>4.设置开机启动<br><br>[java] view plain copy<br><br>    shell&gt; systemctl enable mysqld  <br>    shell&gt; systemctl daemon-reload  <br><br>5.修改root本地登陆密码<br><br>mysql安装完成之后，在/var/log/mysqld.log文件中给root生成了一个默认密码。通过下面的方式找到root默认密码，然后登录mysql进行修改：<br><br>[java] view plain copy<br><br>    shell&gt; grep \'temporary password\' /var/log/mysqld.log  <br><br>root默认密码<br><br>[java] view plain copy<br><br>    shell&gt; mysql -uroot -p  <br>    mysql&gt; ALTER USER \'root\'@\'localhost\' IDENTIFIED BY \'MyNewPass4!\';   <br><br>或者<br><br>[java] view plain copy<br><br>    mysql&gt; set password for \'root\'@\'localhost\'=password(\'MyNewPass4!\');  <br><br>二.安装hive<br><br>1.下载安装文件并解压<br>[java] view plain copy<br><br>    wget http://mirrors.cnnic.cn/apache/hive/hive-1.2.1/apache-hive-1.2.1-bin.tar.gz  <br>    tar -zxvf apache-hive-1.2.1-bin.tar.gz   <br><br>2.配置环境变量<br><br>vi /etc/profile 在最后添加：<br><br>[java] view plain copy<br><br>    export HIVE_HOME=/home/hadoop/apache-hive-2.1.1-bin    <br>    export PATH=$HIVE_HOME/bin:$HIVE_HOME/conf:$PATH   <br><br>然后执行<br><br>[java] view plain copy<br><br>    source /etc/profile  <br><br>使配置文件生效。<br><br>3.修改hive配置文件<br><br>切换到hive安装目录的conf文件夹下<br><br>[java] view plain copy<br><br>    vi hive-site.xml  <br><br>更换成如下配置文件：<br><br>[java] view plain copy<br><br>    &lt;configuration&gt;  <br>    &lt;property&gt;  <br>    &lt;name&gt;javax.jdo.option.ConnectionURL&lt;/name&gt;  <br>    &lt;value&gt;jdbc:mysql://localhost:3306/hive?createDatabaseIfNotExist=true&lt;/value&gt;  <br>    &lt;description&gt;JDBC connect string for a JDBC metastore&lt;/description&gt;  <br>    &lt;/property&gt;  <br>      <br>    &lt;property&gt;  <br>    &lt;name&gt;javax.jdo.option.ConnectionDriverName&lt;/name&gt;  <br>    &lt;value&gt;com.mysql.jdbc.Driver&lt;/value&gt;  <br>    &lt;description&gt;Driver class name for a JDBC metastore&lt;/description&gt;  <br>    &lt;/property&gt;  <br>      <br>    &lt;property&gt;  <br>    &lt;name&gt;javax.jdo.option.ConnectionUserName&lt;/name&gt;  <br>    &lt;!-- 用户名 --&gt;  <br>    &lt;value&gt;root&lt;/value&gt;  <br>    &lt;description&gt;username to use against metastore database&lt;/description&gt;  <br>    &lt;/property&gt;  <br>      <br>    &lt;property&gt;  <br>    &lt;name&gt;javax.jdo.option.ConnectionPassword&lt;/name&gt;  <br>    &lt;!-- 密码 --&gt;  <br>    &lt;value&gt;root&lt;/value&gt;  <br>    &lt;description&gt;password to use against metastore database&lt;/description&gt;  <br>    &lt;/property&gt;  <br>    &lt;/configuration&gt;  <br><br>4.将mysql的连接jar包拷贝到$HIVE_HOME/lib目录下<br><br>即将mysql-connector-Java-5.1.6-bin.jar拷贝到hive的lib目录下。<br><br>5. Jline包版本不一致的问题<br><br>在hive 的lib目录下找到jline-2.12.jar，将其拷贝到Hadoop目录下<br><br>[java] view plain copy<br><br>    share/hadoop/yarn/lib/jline-0.9.94.jar  <br><br>替换掉lib目录下低版本的jline-2.12.jar<br><br>三、启动测试hive<br><br>切换到hive安装目录，执行<br><br>[java] view plain copy<br><br>    bin/hive  <br><br>启动hive<br><br>出现下图表示启动成功：<br><br><br>配置完成。</p>', null, '2017-08-17 10:44:22', '00000000000', '00000000000', '00000000000', '0000000000', '00000000000', '0', '0', '3');
INSERT INTO `t_essay` VALUES ('263030', '195105', 'faith', '运维入门', '<p><!--StartFragment-->运维入门</p><h3>从最低的说起</h3><h4>1.设备</h4><p>网线的线序接法，百兆和千兆网线，光纤线，思科路由，华为路由，交换机什么的，包括一些VLAN组建，交换机和路由器之间的学习，一般我建议学习到CCNP就够了，计算机硬件了解，一般你自己DIY过电脑，一般都清楚明白。了解服务器和普通PC的区别，服务器 分别是 1U 2U 4U，然后就是找托管的托管服务器，费用根据机房线路多少，带宽，地域而决定，注册域名，备案最好也懂。</p><h4>2.数据链路层</h4><p>关乎就是MAC地址的走向，交换机学习，局域网的东西。</p><h4>3.网络层</h4><p>了解中国互联网几大ISP，电信，移动，联通，教育网互相连接的弊端，掌握tcpdump,winshark,的抓包软件，TCP/IP协议，当然也有很多路由器的协议。</p><h4>4.缓存层</h4><p>了解中国几间著名的CDN厂商。</p><p>几个开源缓存的软件</p><ul><li>1.squid</li><li>2.varnish</li><li>3.Traffic Server</li></ul><h4>5.系统层</h4><p>首先是三大系统，Linux,Unix,Windows,市面上一般就用着三个做服务器系统，Linux 是现今互联网的主流所以一般着力学习这个，Windows是Windows 2008 R2,Unix 就是AIX ,Free BSD,这里并无歧视平台的原因，因为win本身的域控管理也十分强大，但由于win的版权问题，费用高昂，大部分都会侧重于Linux的学习，互联网也倾向这个。AIX和Free BSD这个其实学习了Linux,都差不多，只有些不同，有兴趣的朋友可以去学习一下Linux 和 Uninx之间的历史。</p><h4>6.数据库层</h4><p>数据库我自己一般倾向于的Mysql,不过也少有接触Oracle.主要精通一门，估计其它也不难，至于为何选择mysql是因为应用它可以用，深入学习可以了解源码。也有非关系数据库moogoDB</p><h4>7.容器层</h4><p>Tomcat,Nginx,Apache,redis,IIS这里没什么好说的了，各自的语言自己选择各种容器来跑应用。</p><h3>推荐书籍</h3><h4>Linux</h4><p></p><p><!--EndFragment--></p><ul><li>首先是系统的，Linux界可以借鉴一下red hat的RHCE课程</li><li>鸟哥私房菜（必看)（服务器版很一般，不要选择）</li><li>Linux系统管理技术手册(选购，大头书)</li><h4>Windows</h4><p>win服务器推荐几本英文书籍</p><ul><li>Pearson.Windows.Server.2008.Portable.Command.Guide</li><li>Microsoft.Press.Windows.PowerShell.3.0.First.Steps</li><li>Professional.IIS.7</li></ul><p>普通命令 =&gt; bat脚本编写 =&gt; Powershell（相当于Linux的BashShell) =&gt; 域控</p><h3>网络</h3><p>思科的CCNP学习资料（必买，交换机和路由）</p><p>构建高性能Web站点（这本书是必买的，对于初学者，尤其对运维重要)</p><p>TCP/IP 协议一卷（必看)</p><p>构建高可用Linux服务器(选购)</p><h3>脚本</h3><p>Shell（这里没什么建议，我自己没买书，网上看又行，买书也行，京东 china pub自由选择）</p><p>除了懂Shell至于Python Perl ,我建议自己选择，我是Perler所以当然指导你选择Perl</p><p>O\'Reilly：Perl语言入门(必看)</p><p>Perl高效编程（第2版）（选购）</p><p>高阶Perl（选购）</p><h3>Python</h3><p>Python基础教程（必看)</p><p>基础了解之后可以应用一些框架例如Django,tornado,想深入了解当然看看源代码，还有兴趣继续深入，也觉得自己C不错，可以看看Python虚拟机的源代码</p><h3>正则脚本（正则的原理，正则在linux必不可少）</h3><p>正则表达式经典实例 （选看)</p><p>精通正则表达式 （选看)</p><h3>数据库</h3><p>高性能mysql(必看)</p><p>高可用mysql(必看)</p><p>Effective MySQL之备份与恢复（选购)</p><p>oracle database 9i/10g/11g编程艺术:深入数据库体系结构:第2版(如果你用oracle就看看)</p><h3>监控</h3><p>监控类型很多，你可以多上网查看相关内容，如Cact、bmon、nload、iftop、vnstat、iptraf等。</p><h3>总结</h3><p>CLI(Command line)是运维万根之源，对脚本要熟悉随意就能编写，大概排障步骤想好，初学者就参照网上的一键XXX来做个例子吧，再自己改进，例如初始化系统之类，配置ssh,配置参数之类。万丈高楼从地起，以上书籍虽然多，但是还是很有必要看看的。</p></ul>', null, '2017-08-17 11:04:11', '00000000000', '00000000001', '00000000000', '0000000000', '00000000000', '0', '0', '5');
